    public function mailsendApi(Request $request)
    {
        $req = $request;
        $destinatario = $request->input('email');
        $characters = '0123456789';

        // generate a pin based on 2 * 7 digits + a random character
        $pin = $characters[rand(0, 9)].$characters[rand(0, 9)].$characters[rand(0, 9)].$characters[rand(0, 9)].$characters[rand(0, 9)].$characters[rand(0, 9)];
        // shuffle the result
        $codigo = str_shuffle($pin);
        $data = "data:image/png;base64,";
        $img = preg_replace('/^data:image\/\w+;base64,/', '', $data);
        $type = explode(';', $data)[0];
        $type = explode('/', $type)[1];
        $img = str_replace(' ', '+', $img);
        $data = base64_decode($img);
        $details = [
            'base64Data' => $data,
            'type' => 'png',
            'name' => 'logo',
            'title' => 'Código de verificación OEP',
            'body' => 'Se recepcionó la solicitud de código de verificación, para realizar el registro de excusa de jurado electoral.',
            'codigo' => $codigo
        ];
        \Mail::to($destinatario)->send(new MyTestMail($details));

        // save code by user
        // dd("Email is Sent. ". $codigo);
    }
}
